import React from 'react';

class FormButton extends React.Component {

    constructor(props){
        super(props);
    }

    algo = () =>{
        console.log('hay que volver');
    }

    render(){
        return (
            <button id={this.props.id} className={this.props.nameClass} type={this.props.type} onClick={this.algo}>{this.props.label}</button>
        );
    }
}

export default FormButton;
